import React from 'react';
import ReactDOM from 'react-dom';
import Home from './Home';
import Default from './Default';
import Gettest from './Gettest';
import Login from './Login';
import Registration from './Registration';
import testHome from './testHome';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";




ReactDOM.render(
	<BrowserRouter>
      <Switch>
        <Route exact path='/default/:data' caseSensitive={false} element={<Default />} />
        <Route exact path='/gettest/:data' caseSensitive={false} element={<Gettest />} />
        <Route exact path='/register' caseSensitive={false} element={<testHome />} />
        <Route exact path='/' caseSensitive={false} element={<Home />} />
        <Route exact path='/Home/:data' caseSensitive={false} element={<Home />} />
        <Route exact path='/login' caseSensitive={false} element={<Login />} />
        <Route exact path='/registration' caseSensitive={false} element={<Registration />} />
        <Route exact path='/test' caseSensitive={false} element={<test />} />
    </Switch>
    </BrowserRouter>,

	document.getElementById('root'));
